import React, { useState }from 'react';
import { AppBar, Toolbar, IconButton, Typography, InputBase, Drawer, CssBaseline } from '@material-ui/core';
import MenuIcon from '@material-ui/icons/Menu';
import SearchIcon from '@material-ui/icons/Search';



import useStyles from './styles'


export const Navbar = () => {
    const classes = useStyles();
     const [open, setOpen] = useState(false);

     const handleDrawerOpen = () => {
        setOpen(true);
      };

      const handleDrawerClose = () => {
        setOpen(false);
      };


    return (
        <div className={classes.root}>
            <AppBar position="absolute" className={classes.appBar}>
                <CssBaseline />
                <Toolbar>
                    <IconButton edge="start" className={classes.menuButton} color="inherit" aria-label="open drawer"  onClick={handleDrawerOpen}  >
                        <MenuIcon />
                    </IconButton>
                    <Typography className={classes.title} variant="h6" noWrap>
                        CVE ANALYSIS
                    </Typography>
                    <div className={classes.search}>
                        <div className={classes.searchIcon}>
                            <SearchIcon />
                        </div>
                        <InputBase placeholder="Search by CVE-ID" classes={{ root: classes.inputRoot, input: classes.inputInput }} inputProps={{ 'aria-label': 'search' }} />
                    </div>
                </Toolbar>
            </AppBar>
            <Drawer className={classes.drawer} variant="permanent" classes={{ paper: classes.drawerPaper }}>
                <div className={classes.drawerContainer}>
                    hola
                </div>
            </Drawer>
        </div>
    )
}

export default Navbar;
